import { Divider } from 'primereact/divider';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import react from "react";
import "./index.css";
import { useEffect } from 'react';
let datas = [
    {"name": "mgmg",
    "rollno":"mub01"
    },
    {"name": "zawzaw",
    "rollno":"mub02"
    },
    {"name": "kgkg",
    "rollno":"mub03"
    },
    {"name": "chitchit",
    "rollno":"mub04"
    },
    {"name": "zinzin",
    "rollno":"mub05"
    }
    ]
function App(){
    const [users,setUsers]=useEffect([]);
   
   
     function getUsers(){
     
      const users = datas;
      setUsers(users);
      console.log(users);
  
    }
      
    useEffect(()=>{
      getUsers();
  
    },[]);

    return(
        <form className='form'>
               <div className="card">
            <div className="flex flex-column md:flex-row">
                <div className="w-full md:w-5 flex flex-column align-items-center justify-content-center gap-3 py-5">
                    <div className="flex flex-wrap justify-content-center align-items-center gap-2">
                        <label className="w-6rem">Username</label>
                        <InputText id="username" type="text" className="w-12rem" placeholder='Enter your name' value='name'/>
                    </div>
                    <div className="flex flex-wrap justify-content-center align-items-center gap-2">
                        <label className="w-6rem">Password</label>
                        <InputText id="password" type="password" className="w-12rem" placeholder='Enter your roll number' value='pwd'/>
                    </div>
                    <Button label="Login" icon="pi pi-user" className="w-10rem mx-auto" ></Button>
                </div>
                
                
            </div>
        </div>
        </form>
     
       
     
    );
 

};



export default App;
